&lt;br&gt;Construct and design buildings for optimal working conditions. Hire people to design and release software, so you can defeat the simulated competition and take over their businesses. Manage and educate your employees to make sure they are skilled and satisfied with their job.
&lt;br&gt;
&lt;br&gt;Software Inc. combines tycoon gameplay with multi-story building mechanics, employee management and a simulated market. It is inspired by games like Game Dev Tycoon, Prison Architect, The Sims and Theme Hospital.
&lt;br&gt;
&lt;br&gt;&lt;img src="http://cdn.akamai.steamstatic.com/steam/apps/362620/extras/Header2ST.png?t=1459291666"&gt;
&lt;br&gt;&lt;ul class="bb_ul"&gt;
&lt;li&gt;Build, furnish and maintain office buildings up to ten stories + basement, on an enormous Land
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Hire employees to design, develop, support, research and market software in teams
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Build roads and parking to ease commuting for your employees
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Tend to your employees' needs, demands, skills and specializations, while making sure each team has compatible personalities
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Customize your own employee avatar
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Create your own software products and franchises
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Compete in a simulated or event-driven market by selling your products, taking on contract work or trading stocks
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Hire staff to repair your furniture and computers, and clean your office
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Mod what kind of software you can develop, what kind of companies will be simulated, game scenarios, missions, personalities and random name generators
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Delegate important tasks to your team leaders, such as managing development cycles and human resources
&lt;br&gt;&lt;/li&gt;&lt;li&gt;Set up your own servers for products, source control and running your own online store
&lt;/li&gt;&lt;/ul&gt;
